import { Injectable, Logger } from '@nestjs/common';
import axios from 'axios';

@Injectable()
export class MailService {
  private readonly logger = new Logger(MailService.name);

  private readonly BREVO_API = 'https://api.brevo.com/v3/smtp/email';
  private readonly API_KEY = process.env.BREVO_API_KEY;
  private readonly FROM_EMAIL = process.env.MAIL_FROM || 'webnexa.@gmail.com';
  private readonly ADMIN_EMAIL = process.env.ADMIN_EMAIL || 'adjtyathakr@gmail.com';

  private readonly LOGO_BASE64 = '';


  private async sendMail(to: string, subject: string, html: string) {
    try {
      await axios.post(
        this.BREVO_API,
        {
          sender: { email: this.FROM_EMAIL, name: 'WebNexa Tech' },
          to: [{ email: to }],
          subject,
          htmlContent: html,
        },
        {
          headers: {
            'api-key': this.API_KEY,
            'Content-Type': 'application/json',
          },
          timeout: 15000,
        },
      );
    } catch (err) {
      this.logger.error('Mail failed', err?.response?.data || err.message || err);
    }
  }

  // 1 CLIENT AUTO REPLY
  async sendClientMail(to: string, name: string) {
    const html = `
<!DOCTYPE html>
<html>
<body style="margin:0;padding:0;background:#f5f7fb;font-family:Arial,sans-serif;">
  <div style="max-width:600px;margin:0 auto;background:#ffffff;border-radius:12px;overflow:hidden;">
    
    <div style="padding:24px;text-align:center;background:linear-gradient(135deg,#2563eb,#7c3aed);">
      <img src="data:image/png;base64,${this.LOGO_BASE64}" height="50" />
      <h1 style="color:#fff;margin:0;">Thanks for contacting WebNexa </h1>
    </div>

    <div style="padding:32px;color:#1f2937;">
      <h2>Hello ${name},</h2>

      <p>Thank you for reaching out to <b>WebNexa Tech</b>.</p>

      <p>Weve received your request and our team will contact you within <b>24 hours</b>.</p>

      <div style="margin:24px 0;padding:16px;background:#eff6ff;border-radius:8px;">
         Our team is reviewing your requirements.
      </div>

      <p>
        Regards,<br/>
        <b>WebNexa Tech Team</b>
      </p>
    </div>

  </div>
</body>
</html>
`;

    return this.sendMail(to, 'Thanks for contacting WebNexa ', html);
  }

  // 2 ADMIN NOTIFICATION
  async sendAdminMail(dto: any) {
    const html = `
      <h2> New Lead Received</h2>
      <p><b>Name:</b> ${dto.name}</p>
      <p><b>Email:</b> ${dto.email}</p>
      <p><b>Message:</b> ${dto.message}</p>
    `;

    return this.sendMail(this.ADMIN_EMAIL, ' New Lead - WebNexa', html);
  }

  // 3 CONTACTED MAIL
  async sendContactedMail(to: string, name: string) {
    const html = `
<!DOCTYPE html>
<html>
<body style="margin:0;padding:0;background:#f5f7fb;font-family:Arial,sans-serif;">
  <div style="max-width:600px;margin:0 auto;background:#ffffff;border-radius:12px;overflow:hidden;">
    
    <div style="padding:24px;text-align:center;background:linear-gradient(135deg,#16a34a,#22c55e);">
      <img src="data:image/png;base64,${this.LOGO_BASE64}" height="50" />
      <h1 style="color:#fff;margin:0;">Weve Contacted You </h1>
    </div>

    <div style="padding:32px;color:#1f2937;">
      <h2>Hello ${name},</h2>

      <p>Great news! </p>

      <p>Our team has <b>successfully contacted you</b> regarding your request.</p>

      <div style="margin:24px 0;padding:16px;background:#ecfdf5;border-radius:8px;">
         Next step: Requirement discussion & solution planning
      </div>

      <p>
        Regards,<br/>
        <b>WebNexa Tech Team</b>
      </p>
    </div>

  </div>
</body>
</html>
`;

    return this.sendMail(to, 'We have contacted you ', html);
  }

  // 4 CONVERTED MAIL
  async sendConvertedMail(to: string, name: string) {
    const html = `
<!DOCTYPE html>
<html>
<body style="margin:0;padding:0;background:#f5f7fb;font-family:Arial,sans-serif;">
  <div style="max-width:600px;margin:0 auto;background:#ffffff;border-radius:12px;overflow:hidden;">
    
    <div style="padding:24px;text-align:center;background:linear-gradient(135deg,#7c3aed,#2563eb);">
      <img src="data:image/png;base64,${this.LOGO_BASE64}" height="50" />
      <h1 style="color:#fff;margin:0;">Your Project Has Started </h1>
    </div>

    <div style="padding:32px;color:#1f2937;">
      <h2>Hello ${name},</h2>

      <p>Congratulations! </p>

      <p>Your project is now <b>officially started</b>.</p>

      <div style="margin:24px 0;padding:16px;background:#f5f3ff;border-radius:8px;">
         Our team will contact you shortly with next steps.
      </div>

      <p>
        Excited to build this with you!<br/>
        <b>WebNexa Tech Team</b>
      </p>
    </div>

  </div>
</body>
</html>
`;

    return this.sendMail(to, 'Your project has started ', html);
  }
}
